import React, { Component } from "react";
import PropTypes from "prop-types";

class Form1 extends Component {
  constructor() {
    super();

    this.state = {
      email: '',

    };
  }

  handleChange = event => {
    this.setState({
      [event.target.name]: event.target.value
    });
  };



  render() {
    console.log("email " + this.state.email)
    return (
      <div>
        <h1>Aplicant information </h1>
        <div className="field">
          <label> Email </label>
          <input class="input"
          onChange={event => this.handleChange(event)}
          name="email"
          type="text" placeholder="Enter Email" />
        </div>
        <div className="field_col">
          <div>
            <label> Name </label>
            <input onChange={() => this.handleChange()} class="input size"  type="text" placeholder="Enter name" />
          </div>
          <div>
            <label> Surname </label>
            <input class="input size" type="text" placeholder="Enter Surname" />
          </div>
        </div>
        <div className="field">
          <label> Contact </label>
          <input class="input" type="text" placeholder="Enter Contacts" />
        </div>
        <div className="field">
        <label>Pioneer Refs no </label>
        <input class="input" type="text" placeholder="Enter Refs no" />
      </div>
      </div>
    );
  }
}

Form1.propTypes = {};

export default Form1;
